import React from 'react';
import TaskCard from './TaskCard';

export default class DillyDally extends React.Component{
  constructor(props){
    super(props)
    this.state = {
      tasks: []
    };
  }

  getTasks = () => {
    fetch('/tasks',{
      method:'GET'
    })
    .then(response => console.log(response))
    .then(data => this.tasks.push(data));
  }

  render(){
    return(

      <div className={'task'}>
        <TaskCard />
        {this.getTasks()}
      </div>
    )
  }
}
